<pre><code>router.post('/register', upload.array('daycare.DCImage',10),(req, res) =&gt; {
  var paths = req.files.map(file =&gt; file.path)
  const newService = new Services(req.body);
  newService.daycare.DCImage = paths
    newService
        .save(newService)
        .then(data =&gt; {
            res.send(data);
        })
        .catch(err =&gt; {
            res.status(500).send({
              message:
                err.message || &quot;Some error occurred while creating the Service.&quot;
            });
        });
})
</code></pre>
<p>Like <strong>daycare.DCImage</strong> i want to make <strong>grooming.groomingImage</strong>, <strong>trainer.TrainingImage</strong>, <strong>dogwalker.DWImage</strong>, <strong>breeding.breedingImages</strong> fields also to facilitate image uploading.</p>
