NodeJS quiz scoring issue<p>So I have made a quiz website using the &quot;MEN stack&quot; (no React), if you can call it that. The link to the repo is <a href="https://github.com/arkaseth/quiz_website" rel="nofollow noreferrer">here</a>.</p>
<p>While testing the app locally, the quiz works as intended. No issues. The scoring is done once the user submits the form. I have a few keywords for each question, and upon submission, I check if the user has entered any of the keywords I had set. The code for that can be seen below.</p>
<pre><code>router.post(&quot;/submit&quot;, (req, res) =&gt; {
  let sub = Object.values(req.body);
  let ans = [];
  sub.forEach((opt, idx) =&gt; {
    opt = opt.toLowerCase();
    ans[idx] = opt.split(&quot; &quot;);
  });
  let score = 0;
  ans.forEach(async (opt, idx) =&gt; {
    const corr = await Question.findOne({
      index: idx,
    });
    corr.answer = corr.answer.toLowerCase();
    let correct = corr.answer.split(&quot; &quot;);
    let res = correct.some((val) =&gt; {
      return opt.indexOf(val) &gt;= 0;
    });
    if (res) {
      score += 10;
    }
  });
  setTimeout(async () =&gt; {
    const user = await User.findByIdAndUpdate(req.user.id, {
      score,
      completed: true,
      submittedAt: Date.now(),
      answers: sub,
    });
  }, 1000);

  // console.log(req.user.id);
  res.render(&quot;finished&quot;);
});
</code></pre>
<p>As you can see, I had to use a <code>setTimeout</code> to calculate the score, as it wasn't working without it. I guessed the asynchronous nature of the calculating function caused it. If you can suggest a better alternative, it'll be great. An example of one question and its keywords are given below:</p>
<pre class="lang-js prettyprint-override"><code>{
    description: &quot;A company was started by the Maharaja of Mysore, Nalvadi Krishnaraja W...&quot;
    answer: &quot;vote voting voter voters indelible ink&quot;
    index: 3
    __v: 0
}
</code></pre>
<p>Once the quiz went live, we had around 150 participants for the quiz. Upon submission, there was one issue; not all of the users' scores was being calculated correctly. Some were due to different answers from the keywords, but I couldn't find any reason for the other ones.</p>
<p>One such unexplainable instance was as follows. The first pic is of a submission in the actual quiz, the second one is a test I did just now, using the same answers as of that participant:</p>
<p>Actual submission:</p>
<pre class="lang-js prettyprint-override"><code>{
    score: 0
    completed: true
    answers: [
      &quot;Trump Towers&quot;, &quot;Shakuntala Devi&quot;, &quot;Sir&quot;, &quot;Voter ink&quot;, &quot;&quot;,
      &quot;Indian Constitution&quot;, &quot;Saera jahe se accha&quot;, &quot;Sunfeast open&quot;,
      &quot;Dunlop&quot;, &quot;Robert Clive&quot;, &quot;APJ Abdul Kalam&quot;, 
      &quot;Signing the ordinance in Indian emergency&quot;,
      &quot;Indian nuclear operation in pokhran&quot;, &quot;Mohammad Salim&quot;,
      &quot;Swami Vivekananda&quot;, &quot;Bubble wrap&quot;, &quot;&quot;, &quot;Inquilab&quot;,
      &quot;Chintaman ganesh temple&quot;, &quot;Jamtara&quot;
    ]
}
</code></pre>
<p>My test:</p>
<pre class="lang-js prettyprint-override"><code>{
    score: 140
    completed: true
    answers: [
      &quot;Trump Towers&quot;, &quot;Shakuntala Devi&quot;, &quot;Sir&quot;, &quot;Voter ink&quot;, &quot;&quot;,
      &quot;Indian Constitution&quot;, &quot;Saera jahe se accha&quot;, &quot;Sunfeast open&quot;,
      &quot;Dunlop&quot;, &quot;Robert Clive&quot;, &quot;APJ Abdul Kalam&quot;, 
      &quot;Signing the ordinance in Indian emergency&quot;,
      &quot;Indian nuclear operation in pokhran&quot;, &quot;Mohammad Salim&quot;,
      &quot;Swami Vivekananda&quot;, &quot;Bubble wrap&quot;, &quot;&quot;, &quot;Inquilab&quot;,
      &quot;Chintaman ganesh temple&quot;, &quot;Jamtara&quot;
    ]
}
</code></pre>
<p>As you can see, the answers are exactly the same. Even the cases are the same. The correct score for the above submissions is 140, as I have obtained above.</p>
<p>I guess (a wild guess) the issue might be because of the <code>setTimeout</code>. Any alternative for that scoring method will be helpful.</p>
<p>I will be grateful for any help regarding this. Thanks in advance.</p>

