Embed Field: I'm trying to post some data through postman into mongo compass atlas using the following code but get this error<p>TypeError: Cannot read property 'id' of undefined</p>
<pre><code>     exports.createPost = asyncHandler(async (req,res,next)=&gt;{

    //Add user to reqbody
    req.body.user = req.user.id
    const post = await Post.create(req.body)
    res.status(201).json({
        success:true,
        data:post
    })

})
</code></pre>; Answer: Hibernate loads a `SensoreDB` then its `AbitazioneDB` then the `SensoreDB`s for each `AbitazioneDB` then the  `AbitazioneDB` of each  `SensoreDB` etc => infinite loop. You can solve the problem by cutting one side of the relationship. For example, remove the `Set<SensoreDB>` in class `AbitazioneDB`.
